import pytestfrom beopWeb.mod_admin import controllersfrom beopWeb.mod_admin import Userimport jsonimport osfrom werkzeug.datastructures import FileStoragefrom beopWeb.mod_oss.ossapi import *from beopWeb.mod_common.Utils import *name="2.png"@pytest.mark.p0def test_delete_management_file():    file_list = os.getcwd() + "/beopWeb" + User.default_user_pic_path +name    with open(file_list, 'rb') as fp:        file = FileStorage(fp)        controllers.do_upload_management_file([file],name)    rt=controllers.do_delete_management_file({"fileName": name})    rt=json.loads(bytes.decode(rt.data))    oss = OssAPI(Utils.OSS_HOST, Utils.OSS_ACCESS_ID, Utils.OSS_SECRET_ACCESS_KEY)    file_path='custom/management/2.png'    res=oss.get_object('beopweb', file_path)    assert res.status==404,'delete management file fail'